<script>
export default {
  name: "Filters",
  props: {
    from: {
      type: Number,
      default: 0
    },
    to: {
      type: Number,
      default: 0
    }
  },
  data() {
    return {
      value: [this.from, this.to]
    };
  },
  methods: {
    close() {
      this.$error({
        message: "closed"
      });
    },
    apply() {
      this.$close({
        priceRange: { range: this.value },
        filters: this.filters
      });
    },
    login(provider) {
      this.$signIn(provider);
    }
  },
  computed: {
    lastElementIndex() {
      return this.filters.length - 1;
    }
  }
};
</script>
<style lang="scss">
@import "node_modules/include-media/dist/include-media";

.multi-auth-dialog {
  .dialog-content {
    display: grid;
    grid-template-columns: repeat(2, 200px);
    grid-template-rows: repeat(2, 100px);
    gap: 20px;
    grid-template-areas:
      ". ."
      ". .";
    justify-items: center;
    align-items: center;
  }

  .button {
    background-repeat: no-repeat;
    background-size: contain;
    background-position: center;
    border-radius: 10px;
    width: 200px;
    height: 100px;

    border: none;
  }

  .dialog-content {
    height: 500px;
  }
}

@mixin mobile {
  .multi-auth-dialog {
  }
}

@include media("<=tablet") {
  @include mobile;
}

@include media("<=phone") {
  @include mobile;
}
</style>
